import { useState } from "react";
import HomePage from "./HomePage";
import AccountsPage from "./AccountsPage";
import TransactionsPage from "./TransactionsPage";
import BudgetPage from "./BudgetPage";
import ContactInfoPage from "./ContactInfoPage";
import ProfilePage from "./ProfilePage";

function NavigationBar(props) {

    const [pageInfo, setPageInfo] = useState('home');

    function page() {
        if (pageInfo == 'home') {
            return <HomePage username={props.username} />
        } else if (pageInfo == 'accounts') {
            return <AccountsPage username={props.username} />
        } else if (pageInfo == 'transactions') {
            // document.getElementById('homeBtn').classList.remove("bg-transparent");
            // document.getElementById('accountBtn').classList.remove("bg-transparent");
            // document.getElementById('transactionBtn').classList.remove("bg-transparent");
            // document.getElementById('budgetBtn').classList.remove("bg-transparent");
            // document.getElementById('contactinfoBtn').classList.remove("bg-transparent");
            // document.getElementById('profileBtn').classList.remove("bg-transparent");
            // document.getElementById('transactionBtn').classList.add("bg-primary");
            return <TransactionsPage username={props.username} />

        } else if (pageInfo == 'budget') {

            return <BudgetPage username={props.username} />
        } else if (pageInfo == 'profile') {

            return <ProfilePage username={props.username} />
        } else {

        }
    }

    function chageTheme() {
        if (props.styles.bgColor == 'white' && props.styles.txColor == 'black') {
            props.setStyles({ bgColor: 'rgb(60, 60, 60)', txColor: 'rgb(125, 125, 125)' });
        } else {
            props.setStyles({ bgColor: 'white', txColor: 'black' });
        }
    }

    return (<>
        <nav className="navbar navbar-expand-lg bg-dark sticky-top">
            <div className="container-fluid">
                <button id="homeBtn" className="border-0 bg-dark navbar-brand" onClick={() => setPageInfo('home')}>
                    <img src="FinSyncIcon.png" id="navBrandLogo" style={{ height: '40px' }} alt="Logo" />
                    <label htmlFor="navBrandLogo" className="text-white fs-3" style={{ cursor: "pointer" }}>
                        &nbsp;FinSync
                    </label>
                </button>
                <ul className="navbar-nav ms-auto flex-row">
                    <li className="nav-item m-1">
                        <button id="contactinfoBtn" className="border-0 bg-dark nav-link" onClick={() => chageTheme()}>
                            {(props.styles.bgColor == 'white' && props.styles.txColor == 'black') ?
                                <i class="bi bi-moon-stars text-white"></i> : <i class="bi bi-sun text-white"></i>
                            }
                        </button>
                    </li>
                    <li className="nav-item m-1">
                        <button id="profileBtn" className="btn border-1 border-secondary rounded-circle bg-secondary" onClick={() => setPageInfo('profile')}>
                            {/* <img src="FinSyncIcon.png" style={{ height: '25px', width: '25px' }} alt="" /> */}
                            <i class="bi bi-person-fill text-white"></i>
                        </button>
                    </li>
                    <li className="nav-item m-1">
                        <button className="btn btn-danger" onClick={() => props.logOutUser()}>
                            Log&nbsp;Out
                        </button>
                    </li>
                </ul>
            </div>
        </nav>
        <div className="container-fluid" style={{ backgroundColor: props.styles.bgColor, color: props.styles.txColor }}>
            <div className="row">
                <div className="col-lg-2 col-md-3 col-4 text-center fs-5 ps-md-3 p-0" style={{ backgroundColor: 'rgb(247, 247, 254)', borderRight: '2px solid rgb(232, 232, 232)' }}>
                    <nav className="navbar navbar-expand-lg" style={{ position: 'fixed' }}>
                        <div className="container-fluid">
                            <ul className="navbar-nav flex-column fs-3">
                                <li className="nav-item m-1">
                                    <button id="hometBtn" className="text-dark bg-primary border-0 btn-primary nav-link rounded-pill" onClick={() => setPageInfo('home')}>
                                        <i class="bi bi-house-door"></i>&nbsp;Home
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="itemsBtn" className="text-dark border-0 bg-transparent nav-link" onClick={() => setPageInfo('items')}>
                                        <i class="bi bi-bag-dash"></i>&nbsp;Items
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="accountBtn" className="text-dark border-0 bg-transparent nav-link" onClick={() => setPageInfo('accounts')}>
                                        <i class="bi bi-bank"></i>&nbsp;Banking
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="transactionBtn" className="text-dark border-0 bg-transparent nav-link" onClick={() => setPageInfo('transactions')}>
                                        <i class="bi bi-send"></i>&nbsp;Transaction
                                    </button>
                                </li>
                                <li className="nav-item m-1">
                                    <button id="budgetBtn" className="text-dark border-0 bg-transparent nav-link" onClick={() => setPageInfo('budget')}>
                                        <i class="bi bi-wallet2"></i>&nbsp;Budget
                                    </button>
                                </li>
                            </ul>
                        </div>
                    </nav>
                </div>
                <div className="col-lg-10 col-md-9 col-8 p-0">
                    <div className="">
                        {page()}
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Quia, assumenda. Quibusdam accusantium quia delectus repellendus ex, id quae, obcaecati placeat laboriosam laudantium soluta vel quaerat sunt cum sit voluptate adipisci nulla totam saepe exercitationem excepturi dolore maxime! Magni perspiciatis sed exercitationem ab vero cumque numquam, eum pariatur ipsa! Facilis optio beatae, modi et id sed quam iste, dolorem nobis repudiandae maiores vitae illo expedita explicabo quidem tenetur delectus ea deleniti consequatur asperiores corrupti illum amet? Nemo eaque aliquid tempora provident, quae perferendis quaerat sapiente atque veritatis beatae, laborum voluptas, dolorem fuga. Dolorem velit minus porro mollitia minima similique nihil ex eaque qui magnam est et optio voluptatem excepturi, fugit recusandae error, ipsa autem? Minus sint minima necessitatibus earum magnam sapiente debitis alias incidunt asperiores, exercitationem sunt placeat consectetur veritatis, accusamus mollitia? Ad doloremque, reiciendis qui at neque enim veniam modi quos impedit? Animi sunt quaerat, tempora autem excepturi explicabo numquam eum perspiciatis fuga vitae harum minima, alias consectetur at ex debitis suscipit? Harum quae pariatur expedita explicabo amet? Repellendus dolorem sapiente beatae molestiae tempora accusamus omnis ratione quidem pariatur accusantium quas rem, exercitationem dolor porro at aperiam minima dolorum magnam eaque dolores eos nisi ad. Accusamus velit expedita totam? At eligendi quisquam, porro dicta in perspiciatis a omnis aliquam sequi eos magnam quod molestiae tenetur accusamus. Odio, minima! Quisquam accusantium sit dicta cumque porro id nam est, quasi tempore corporis dolor nostrum quam doloribus, neque alias nemo? Quasi nulla perferendis officia unde rerum atque est totam sequi doloribus vel ad nobis quis, ipsa nemo a dolorem nisi temporibus sit alias recusandae quae laudantium! Quia cumque odio dolore, dolorem ipsum quae optio? Iure ver